import React from "react";

const Tutorials = (props)=>{
    setTimeout(()=>{
        props.hitory.push('/Docs')
    },5000)
    return (
        <div className="container">
            <h1>Tutorial : Intro to React</h1>
        </div>
    )
}
export default Tutorials
